import{_ as e,o as r,c as i,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 44-98 Interference with employment of members of Virginia National Guard or Virginia Defense Force.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/44-98.md","filePath":"vacode/44-98.md"}'),o={name:"vacode/44-98.md"},a=n('<h1 id="§-44-98-interference-with-employment-of-members-of-virginia-national-guard-or-virginia-defense-force" tabindex="-1">§ 44-98 Interference with employment of members of Virginia National Guard or Virginia Defense Force. <a class="header-anchor" href="#§-44-98-interference-with-employment-of-members-of-virginia-national-guard-or-virginia-defense-force" aria-label="Permalink to &quot;§ 44-98 Interference with employment of members of Virginia National Guard or Virginia Defense Force.&quot;">​</a></h1><p>A person who, either by himself or with another, deprives a member of the Virginia National Guard or Virginia Defense Force of his employment, or prevents, by himself or another, such member being employed, or obstructs or annoys such member or his employer at his trade, business, or employment, because such member of such organization is such member, or dissuades any person from enlistment in the Virginia National Guard or Virginia Defense Force by threat or injury to him in his trade, business, or employment in case he shall so enlist, shall be guilty of a misdemeanor and on conviction thereof shall be fined in a sum not exceeding $500, or imprisonment in jail not more than 30 days, or shall suffer both fine and imprisonment.</p><p>1930, p. 967; Michie Code 1942, § 2673(83); 1958, c. 393; 1984, c. 765; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0572" target="_blank" rel="noreferrer">572</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0586" target="_blank" rel="noreferrer">586</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0221" target="_blank" rel="noreferrer">221</a>.</p>',3),t=[a];function s(m,l,c,f,h,d){return r(),i("div",null,t)}const u=e(o,[["render",s]]);export{g as __pageData,u as default};
